State files an Amended Information charging 2 cts. Possess THC, contrary to Section 961.41(3g)(e) of the Wisconsin Statutes.  
No contest pleas to the amended charges.   Convicted.    Sentences are withheld.   Defendant is placed on probation to DOC for twelve (12) months.  Conditions of probation are:
1) Spend five (5) days in the Manitowoc County Jail, under the Huber Law, to commence on 09-30-15 at 5:00 p.m.   Transfer to Calumet County Jail is authorized or in the alternative travel outside of Manitowoc County for purposes of employment;
2) Obtain GED/HSED;
3) Submot to random urine screens and pay for same;
4) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
5) Maintain full-time employment/schooling combination;
6) AODA assessment and follow through; 
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC;
9) Maintain absolute sobriety.
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief.   
Minutes.
